import React from 'react';
import { NavLink } from "react-router-dom";
import Housing from '../../public/logements.json';

function Card() {
    return(
        <div>
            {Housing.map((data)=>(
                <div key= {'{data.id}'}>
                    <NavLink to={'/Houssing/${data.id'}>
                    <div>
                        <img src={data.cover} alt={data.titel} />
                        <h2>{data.titel}</h2>
                    </div>

                    </NavLink>
                </div>

            ) )}
        </div>
    )

}
export default Card
